import React, { useEffect, useState } from "react";
import Navbar from '../Nav'
import './fetch.css'
import { Link } from "react-router-dom";
import Footer from "../Footer";

function Fetch() {
  const [data, setData] = useState([]);

  // Function to fetch data for a specific AWB number
  const fetchDataForAWB = (awbNumber) => {
    fetch(`http://172.22.81.182:8080/rfid/getstat/${awbNumber}`)
      .then((response) => response.json()) // Assuming the response is JSON
      .then((data) => {
        // Assuming the data is an object with properties you need
        console.log("Fetched Data:", data);

        // Navigate to the ProgressBar component with the data
        window.location.href = `/shipping/${awbNumber}`;
      })
      .catch((error) => {
        console.error('Error fetching data from API:', error);
      });
  };

  useEffect(() => {
    const fetchData = () => {
      fetch("http://172.22.81.182:8080/rfid/getall")
        .then((response) => response.json())
        .then((actualData) => {
          console.log(actualData);
          setData(actualData);
        })
        .catch((err) => {
          console.error(err.message);
        });
    };

    fetchData();
  }, []);

  return (
    <div>
      <div>
        <Navbar />
      </div>
      <div className="overflow-x-auto mt-8 shadow-black">
        <table className="table table-zebra mx-auto w-1/2">
          <thead className="bg-yellow-400 text-black">
            <tr>
              <th className="text-center w-1/4">AWB</th>
              <th className="text-center w-1/4">Sender Data</th>
              <th className="text-center w-1/4">Origin Data</th>
              <th className="text-center w-1/4">Destination</th>
              <th className="text-center w-1/4">Tracking</th>
            </tr>
          </thead>
          <tbody className='tboby'>
            {data.map((item, index) => (
              <tr key={index}>
                <td className="text-center align-middle w-1/4">{item.awb}</td>
                <td className="text-center align-middle w-1/4">{item.sender_data}</td> 
                <td className="text-center align-middle w-1/4">{item.origin_data}</td>
                <td className="text-center align-middle w-1/4">{item.destination_data}</td>
                <td>
                  {/* Button to fetch data for the specific AWB */}
                  <button
                    className="btn hover:bg-yellow-400 hover:text-black"
                    onClick={() => fetchDataForAWB(item.awb)}
                  >
                    Track
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
        <Footer />
      </div>
    </div>
  );
}

export default Fetch;
